import React from "react";


function StudentListItem({item }) {
  return (
    <li key={item}>
    <Link to={`/StudentEvaluation/${item}`}style={{ textDecoration: 'none' }} className="menu-item">{item}</Link>  
    </li>
  );
}

export default StudentListItem;
